import React from 'react';
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav className="Nav">
    	<ul>
    		<li>HOME</li>
    		<li>PORTFOLIO</li>
    		<li>CONTACT ME</li>
    	</ul>
    </nav>
  );
}

export default Nav;
